        "description": "Camila Cabello Is The Master At Uncomfortable Interviews, Falling Down, And Overall Embarrassing Moments. \nSubscribe: https://goo.gl/Hnoaw3\n-----------------------------------------------------------------------------------------\n\nCan you remember your most embarrassing moment ever? There is a good chance it probably plagues you at night and haunts your dreams. It’s ok, most people probably don’t remember, and thankfully that moment for you most likely was not caught on camera. You can breathe now. Thank goodness you’re not famous! For celebrities, unfortunately, there is a very good chance that some of their most embarrassing moments were captured on camera either on a live television broadcast of an awards show, by a fan with a camera on their phone, or maybe a moment that happened mid-interview. For Camila Cabello, this is a very serious reality. We loved her when she was a part of the supergroup Fifth Harmony, and we love her even more now as a solo artist. \n\nAs much as we love to watch her flawlessly perform her hit songs like “Havana” and “Señorita”, sometimes Camila is just like us. Yes, this pop star also has tons of embarrassing and awkward moments like falling on stage, saying the wrong things at the wrong times, and even being left hanging for high-fives for what feels like an eternity.  Don’t even get us started on some of these super embarrassing red carpet moments! Even some of the cutest moments between her and Shawn Mendes (of which there are so many) are no match for their embarrassing moments together where they just can’t seem to get in sync with one another. Yep, this power couple even has awkward moments too! \n\nCamila Cabello may be on the verge of superstardombut that doesn’t excuse her from silly moments where, let’s face it, she totally embarrasses herself. \n\n-----------------------------------------------------------------------------------------\nOur Social Media:\nFacebook: https://www.facebook.com/TheTalko\nTwitter: https://twitter.com/thetalko\nInstagram: https://instagram.com/the_talko\n\n-----------------------------------------------------------------------------------------\nFor more videos and articles visit:\nhttp://www.thetalko.com/",
